import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Your automation logic here
    // Locate and fill the minimum price input
    const minPriceInputLocator = page.locator('input.price-input[placeholder="Min"]');
    await minPriceInputLocator.waitFor({ state: 'visible', timeout: 5000 });
    await minPriceInputLocator.fill('50');

    // Locate and fill the maximum price input
    const maxPriceInputLocator = page.locator('input.price-input[placeholder="Max"]');
    await maxPriceInputLocator.waitFor({ state: 'visible', timeout: 5000 });
    await maxPriceInputLocator.fill('200');

    // Take screenshot after filling inputs
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_prices_entered.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_prices_entered.png'));

    // Locate and click the apply filter button
    const applyButtonLocator = page.getByRole('button', { name: 'Apply' });
    await applyButtonLocator.waitFor({ state: 'visible', timeout: 5000 });
    await applyButtonLocator.click();

    // Take final screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_filter_applied.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_filter_applied.png'));

    // Extract data to verify
    const minPriceValue = await minPriceInputLocator.inputValue();
    const maxPriceValue = await maxPriceInputLocator.inputValue();

    return {
      success: true,
      action: "Applied price range filter from 50 to 200.",
      extractedData: {
        minPrice: minPriceValue,
        maxPrice: maxPriceValue
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to apply price range filter",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
